import React, { useEffect, useState } from "react"
import { useParams } from "react-router-dom"

// Define the structure of the user profile data
interface UserProfileProps {
  id: number
  name: string
  email: string // Include email or other fields as needed
}

export const UserProfile: React.FC = () => {
  // Extract user ID from URL parameters
  const { id } = useParams<{ id: string }>()

  // State to hold user profile data
  const [userProfile, setUserProfile] = useState<UserProfileProps | null>(null)
  const [loading, setLoading] = useState<boolean>(true)
  const [error, setError] = useState<string | null>(null)

  useEffect(() => {
    // Fetch user data based on the user ID
    const fetchUserProfile = async () => {
      try {
        const response = await fetch(
          `https://jsonplaceholder.typicode.com/users/${id}`
        )
        if (!response.ok) {
          throw new Error("User not found")
        }
        const data: UserProfileProps = await response.json()
        setUserProfile(data)
      } catch (error: any) {
        setError(error.message)
      } finally {
        setLoading(false)
      }
    }

    if (id) {
      fetchUserProfile()
    }
  }, [id])

  if (loading) return <div>Loading...</div>
  if (error) return <div>Error: {error}</div>
  if (!userProfile) return <div>User not found</div>

  return (
    <div>
      <h1>{userProfile.name}'s Profile</h1>
      <p>Email: {userProfile.email}</p>
      {/* Display other user details as needed */}
    </div>
  )
}
